import Button from 'react-bootstrap/Button';

function Buttonx() {
  return (
    <>
      <Button variant="Primary" size='lg'>Admin</Button>{' '}
      <Button variant="Primary" size='lg'>Doctor</Button>{' '}
      <Button variant="Primary" size='lg'>Patient</Button>{' '}
    </>
  );
}

export default Buttonx;
